import React from 'react';
import { Text, Div, Tag, Anchor, Button, Collapse} from "atomize";


class Rarity extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
          showCollapse: false
        };
    }

    render() { 

        const { selectedCode, showCollapse } = this.state;

        return (
            <>
                <Button
                    onClick={() => this.setState({ showCollapse: !showCollapse })}
                    m={{ b: "10px" }}
                    rounded="circle"
                    hoverBg="gray800"
                    bg="black900"
                    shadow="3"
                    hoverShadow="4"
                >
                    Rarity Table
                </Button>
                <Collapse isOpen={showCollapse}>
                    <Div
                    bg="gray100"
                    border="1px solid"
                    borderColor="gray400"
                    rounded="lg"
                    m={{ b: "20px" }}
                    >
                    {["This", "section", "is", "inside", "collapse"].map(
                        (name, index) => (
                        <Div
                            p={{ x: "1rem", y: "0.75rem" }}
                            border={{ b: index !== 4 && "1px solid" }}
                            borderColor="gray400"
                        >
                            {name}
                        </Div>
                        )
                    )}
                    </Div>
                </Collapse>
            </>
        );
    }
}

export default Rarity;
